import React from "react";
import NavBar from "../components/navbar";
import Footer from "../components/footer";

export default function AboutUs() {
    return (
        <>
            <NavBar />
            <h1>Who is Wild Fly?</h1>
            <p>Wild Fly Brewing is a small, family operated micro brewery. We started with the simple idea of turning what we loved doing into our something new + enjoyable for our community and sustainable for our family. Our little brewery is located less than a mile from our home in downtown Everson, WA</p>
            <Footer />
        </>
    )
};
